import './App.css';
import { useState } from 'react';

const Numbers = (props) => {
  return (
    <>
    <h3>{props.first} {props.operator} {props.second} = </h3>
    </>
  )
}


const App = () => {

  var f;
  var s;
  const [newEq, setNewEq] = useState(true);

  if (newEq) {
    var opNum = Math.random() * 4
    f = Math.random() * 99 + 2;
    s = Math.random() * 99 + 2;
    setNewEq(false);
  }

  return (
    <div className="App">
      <div className='rectangle'>
        <h5>f - {s} = </h5>
        <Numbers first={f} operator={"-"} second={s}></Numbers>
      </div>
    </div>
  );
}

export default App;
